import React from "react";
import { PropsFlags } from '../interfaces/flags/Flags.interfaces';

const CO = (props: PropsFlags): JSX.Element => {
    const { rounded } = props;

    const RectFlagComponent = (propsRect: any) => {
        const { width, height, className } = propsRect;

        return (
            <svg width={width} height={height} className={className} {...propsRect} viewBox="0 0 512 512" fill="none" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink">
                <rect width="512" height="512" fill="url(#pattern0)" />
                <defs>
                    <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
                        <use xlinkHref="#image0_7:3" transform="scale(0.00195312)" />
                    </pattern>
                    <image id="image0_7:3" width="512" height="512" xlinkHref="data:image/png;base64," />
                </defs>
            </svg>
        );
    }

    const RoundedFlagComponent = (propsRounded: any) => {
        const { width, height, className } = propsRounded;

        return (
            <svg width={width} height={height} className={className} {...propsRounded} viewBox="0 0 512 512" fill="none" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink">
                <rect width="512" height="512" fill="url(#pattern0)" />
                <defs>
                    <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
                        <use xlinkHref="#image0_7:5" transform="scale(0.00195312)" />
                    </pattern>
                    <image id="image0_7:5" width="512" height="512" xlinkHref="data:image/png;base64," />
                </defs>
            </svg>
        );
    }

    if (!rounded) {
        return (
            <React.Fragment>
                <RectFlagComponent {...props}/>
            </React.Fragment>
        );
    } else {
        return (
            <React.Fragment>
                <RoundedFlagComponent {...props}/>
            </React.Fragment>
        );
    }




}

export default CO;